import styled from "styled-components";

export const CircleDiv = styled.div`
  position: relative;
  display: flex;
  width: 60px;
  height: 60px;
  justify-content: center;
  align-items: center;
  flex-direction: column;
`;

export const Percent = styled.div`
  position: relative;
  width: 30px;
  height: 30px;

  & svg {
    position: relative;
    width: 200px;
    height: 200px;
  }
  & circle {
    width: 30px;
    height: 30px;
    fill: none;
    stroke-width: 10;
    stroke: #000;
    transform: translate(5px, 5px);
    stroke-dasharray: 440;
    stroke-dashoffset: 440;
  }
  & circle:nth-child()
`;

export const Number = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 55px;

  & h2 {
    font-size: 20px;
  }
`;
